import bgImage from "./bgImage.png"
import logo from "./logo.png"
function App() {
  return <>
        <div className="pageWrapper" style={{backgroundImage: `url(${bgImage})`}}>
          <img src={logo} alt="Logo" />
          <img src={leftPumpkin} alt="Image Not Found" />
          <img src={rightPumpkin} alt="Image Not Found" />
        </div>
    </>;
}

export default App;
